@echo off
if exist bootstrap.cmd (
  call bootstrap.cmd
)

set buildFile=build.fsx
"packages/Yaaf.AdvancedBuilding/content/build.cmd" %*

// ----------------------------------------------------------------------------
// This file is subject to the terms and conditions defined in
// file 'LICENSE.txt', which is part of this source code package.
// ----------------------------------------------------------------------------
#load "packages/Yaaf.AdvancedBuilding/content/buildConfigDef.fsx"
#load @"buildConfig.fsx"
#load "packages/Yaaf.AdvancedBuilding/content/buildInclude.fsx"

open System.IO
open Fake
let config = BuildInclude.config
// Define your FAKE targets here

let MyTarget = BuildInclude.MyTarget

BuildInclude.documentationFAKEArgs <- "-nc"

// This step ensures our current build is still compatible with FSharp.Formatting.
MyTarget "CopyToFSharpFormatting" (fun _ ->
    // make the FSF load script happy
    [ "build/net45/RazorEngine.dll"; "packages/net45/Microsoft.AspNet.Razor/lib/net45/System.Web.Razor.dll" ]
    |> Seq.iter (fun source ->
      let dest = sprintf "packages/FSharp.Formatting/lib/net40/%s" (Path.GetFileName source)
      //try
      if File.Exists dest then
        trace (sprintf "Deleting %s" dest)
        File.Delete dest
      trace (sprintf "Copying %s to %s" source dest)
      File.Copy (source, dest)
      //with e ->
      //  trace (sprintf "Couldn't copy %s to %s, because: %O" source dest e)
    ))

"AfterBuild"
    ==> "CopyToFSharpFormatting"
    ==> "AllDocs"

// start build
RunTargetOrDefault "All"

// ----------------------------------------------------------------------------
// This file is subject to the terms and conditions defined in
// file 'LICENSE.txt', which is part of this source code package.
// ----------------------------------------------------------------------------
// Get any working NuGet.exe

#load "packages/Yaaf.AdvancedBuilding/content/downloadNugetInclude.fsx"

// ----------------------------------------------------------------------------
// This file is subject to the terms and conditions defined in
// file 'LICENSE.txt', which is part of this source code package.
// ----------------------------------------------------------------------------
open System.IO
// Force to load our build!
// As long as FSharp.Formatting is using the regular net45 build
// This should work as expected.
#I @"build/net45"
#r @"build/net45/System.Web.Razor.dll"
#r @"build/net45/RazorEngine.dll"

#load "packages/Yaaf.AdvancedBuilding/content/buildConfigDef.fsx"
#load @"buildConfig.fsx"
#load "packages/Yaaf.AdvancedBuilding/content/generateDocsInclude.fsx"
open Fake
// Force load of System.Web.Razor.dll
let someType = typeof<System.Web.Razor.RazorEngineHost>
let printAssemblies msg =
  printfn "%s. Loaded Assemblies:" msg
  System.AppDomain.CurrentDomain.GetAssemblies()
    |> Seq.choose (fun a -> try Some (a.GetName().FullName, a.Location) with _ -> None)
  //|> Seq.filter (fun l -> l.Contains ("Razor"))
    |> Seq.iter (fun (n, l) -> printfn "\t- %s: %s" n l)

printAssemblies "starting documentation generation"
try RunTargetOrDefault "LocalDoc"
finally
  printAssemblies "Documentation generation finished"

printfn "THE END"
